import {Component, EventEmitter, Output, ViewChild} from '@angular/core';
import {PointService} from "../../service/point.service";
import {FormArray, FormBuilder, FormGroup} from "@angular/forms";
import {PointRequestDto} from "../../dto/point-request-dto";
import {PointResponse} from "../../dto/point-response";
import { MultiSelectModule } from 'primeng/multiselect';
@Component({
  selector: 'app-point-form',
  templateUrl: './point-form.component.html',
  styleUrls: ['./point-form.component.css']
})
export class PointFormComponent {

  pointForm = FormGroup;


  @Output() addEvent = new EventEmitter<PointResponse>();
  @Output() rChangeEvent = new EventEmitter<number>()
  errorMessage: string = "";


  x_values: number[] = [-5, -4, -3, -2, -1, 0, 1, 2, 3];
  r_values: number[] = [-5, -4, -3, -2, -1, 0, 1, 2, 3];
  y_values: any;

  constructor(private pointService: PointService,
              private formBuilder: FormBuilder) {
    this.pointForm = this.formBuilder.group({
      points: this.formBuilder.array([])
    });
  }
  get points(): FormArray {
    return this.pointForm.get('points') as FormArray;
  }
  addPoint(): void {
    const pointGroup = this.formBuilder.group({
      x_value: '',
      y_value: '',
      r_value: ''
    });
    this.points.push(pointGroup);
  }
  removePoint(index: number): void {
    this.points.removeAt(index);
  }
  onSubmit(): void {
    this.errorMessage = "";

    this.points.controls.forEach(pointGroup => {
      if (pointGroup.value.x_value === '' || pointGroup.value.x_value == null) {
        this.errorMessage = "X value is required";
      } else if (pointGroup.value.y_value === '' || pointGroup.value.y_value == null) {
        this.errorMessage = "Y value is required";
      } else if (pointGroup.value.r_value === '' || pointGroup.value.r_value == null) {
        this.errorMessage = "R value is required";
      } else {
        let point = new PointRequestDto(
          +pointGroup.value.x_value,
          +pointGroup.value.y_value,
          +pointGroup.value.r_value,
        );

        this.pointService.savePoint(point).subscribe(
          data => {
            console.log("New point " + data.currentTime);
            this.addEvent.emit(data);
          },
          error => {
            console.log(error);
          }
        );
      }
    });
  }

  onChangeR(e: any):void{
    if (e.target.value != ""){
      console.log();
      this.rChangeEvent.emit(e.target.value.split(": ")[1]);
    }

  }

}
<div class="card text-white bg-dark m-auto" style="max-width: 65%">
  <div class="card-header text-center">Add new point</div>
  <div class="card-body" style="background-color: #d5d5d5">
    <form [formGroup]="pointForm" (ngSubmit)="onSubmit()">

      <div formArrayName="points">
        <div *ngFor="let pointGroup of points.controls; let i = index" [formGroupName]="i">
          <div class="form-group">
            <label>Choose X value</label>
            <p-multiSelect formControlName="x_value" [options]="x_values" defaultLabel="Choose X value"
                           appendTo="body"></p-multiSelect>
          </div>

          <div class="form-group">
            <label>Choose Y value</label>
            <p-slider formControlName="y_value" [min]="-3" [max]="5" [step]="1" vertical="true"
                      style="height: 200px;"></p-slider>
          </div>

          <div class="form-group">
            <label>Choose R value</label>
            <p-multiSelect formControlName="r_value" [options]="r_values" defaultLabel="Choose R value"
                           appendTo="body"></p-multiSelect>
          </div>

          <button type="button" class="btn btn-danger" (click)="removePoint(i)">Remove Point</button>
        </div>
      </div>

      <button type="button" class="btn btn-primary" (click)="addPoint()">Add Point</button>

      <button class="btn btn-primary" type="submit">Submit</button>

      <div *ngIf="errorMessage !== ''" class="alert alert-danger" style="margin-top: 10px;">
        {{errorMessage}}
      </div>

    </form>
  </div>
</div>
